    [Route("api/[controller]")]
    [ApiController]
    public class CerController : ControllerBase
    {
        private readonly Certificate _Cer;
        private readonly IConfiguration configuration;
        public CerController(IConfiguration _configuration)
        {
            configuration = _configuration;
            _Cer = new Certificate(configuration);
        }

        [HttpPost("")]
        public async Task<IActionResult> Index([FromQuery] string cipher)
        {
            return Ok("Cer Ok");
        }

        // GET api/<ValuesController>/5
        [HttpPost("CreateSelfCA")]
        public async Task<IActionResult> CreateSelfCA([FromQuery] string issued, [FromQuery] string password, [FromQuery] string fileName, [FromQuery] int expireAfter = 30)
        {
            bool createdResult = await _Cer.createSelfCer(issued, password, fileName, expireAfter);
            //bool createdResult = true;

            return Ok(createdResult);
        }

        [HttpPost("SignPDF")]
        public async Task<IActionResult> SignPDF([FromBody] SignContract contract)
        {
            try
            {
                //contract.PdfPath = @"C:\Users\admin\Desktop\CerFile\" + contract.PdfPath;
                var result = await _Cer.signPdf(contract.PdfPath, contract.Xfdf, contract.PfxPath, contract.PassWord, contract.StepNo);
                var response = new {
                    Data = result,
                    Status = true,
                };
                return Ok(response);
            }
            catch (Exception ex)
            {
                throw new HttpRequestException(ex.Message, ex, HttpStatusCode.ExpectationFailed);
            }
